package feedback_v1

import (
	"std"
	"strings"
	"time"

	"gno.land/p/demo/ufmt"
)

const (
	maxCharsCount = 256
	notFoundIndex = -1

	// ownerAddr is wallet address of realm admin.
	ownerAddr = std.Address("g1rdld2ay4c3r3eghk563sz6ne79mmplcl8zatuu")

	pkgPath          = "r/gnostudio/feedback_v1"
	realmViewPath    = "https://test4.gno.land/" + pkgPath
	feedbackFormPath = "https://gno.studio/connect/view/gno.land/" + pkgPath + "?network=test4#SubmitFeedback"
)

var (
	// HTML escaping.
	htmlQuot = []byte("&#34;") // shorter than "&quot;"
	htmlApos = []byte("&#39;") // shorter than "&apos;" and apos was not in HTML until HTML5
	htmlAmp  = []byte("&amp;")
	htmlLt   = []byte("&lt;")
	htmlGt   = []byte("&gt;")
	htmlNull = []byte("\uFFFD")
)

type Feedback struct {
	ID        int
	User      std.Address
	Content   string
	Response  string
	CreatedAt time.Time
	RespondAt time.Time
}

var (
	nextID            = 1
	isLocked          = false
	feedbacks         = []Feedback{}
	modAddrs          = []std.Address{}
	migratedRealmPath = ""
)

func stripHtml(input string) string {
	// Copy from Go's `template.HTMLEscape`.
	// See: $GOROOT/src/text/template/funcs.go

	// Avoid allocation if we can.
	if !strings.ContainsAny(input, "'\"&<>\000") {
		return input
	}

	b := []byte(input)
	w := strings.Builder{}
	last := 0
	for i, c := range b {
		var html []byte
		switch c {
		case '\000':
			html = htmlNull
		case '"':
			html = htmlQuot
		case '\'':
			html = htmlApos
		case '&':
			html = htmlAmp
		case '<':
			html = htmlLt
		case '>':
			html = htmlGt
		default:
			continue
		}
		w.Write(b[last:i])
		w.Write(html)
		last = i + 1
	}

	w.Write(b[last:])
	return w.String()
}

func findFeedback(id int) (int, bool) {
	// TODO: use avl and seqid when will move to test4
	for i := range feedbacks {
		if feedbacks[i].ID == id {
			return i, true
		}
	}

	return notFoundIndex, false
}

func findModerator(addr std.Address) int {
	for i, modAddr := range modAddrs {
		if modAddr == addr {
			return i
		}
	}

	return notFoundIndex
}

func assertAddrValid(addr std.Address) {
	// std.Address.IsValid() not available on test3
	_, _, ok := std.DecodeBech32(addr)
	if !ok {
		panic("Invalid wallet address")
	}
}

// assertIsModerator checks whether a current caller is owner or a moderator.
func assertIsModerator() {
	actorId := std.GetOrigCaller()
	isAllowed := actorId == ownerAddr || findModerator(actorId) != notFoundIndex
	if !isAllowed {
		panic("Access Denied")
	}
}

// assertIsOwner checks whether a current caller is a realm owner.
func assertIsOwner() {
	actorId := std.GetOrigCaller()
	isAllowed := actorId == ownerAddr
	if !isAllowed {
		panic("Access Denied")
	}
}

// assertNotLocked interrupts execution if realm is locked.
func assertNotLocked() {
	if isLocked {
		panic("Realm is locked")
	}
}

// LockRealm locks the realm, preventing further feedback submissions.
func LockRealm() string {
	assertIsOwner()
	isLocked = true
	return "Locked"
}

// UnlockRealm unlocks the realm, allowing further feedback submissions.
func UnlockRealm() string {
	assertIsOwner()
	isLocked = false
	migratedRealmPath = ""
	return "Unlocked"
}

// SubmitFeedback allows users to submit their feedback about GnoStudio.
func SubmitFeedback(message string) string {
	assertNotLocked()

	message = strings.TrimSpace(message)
	if message == "" {
		panic("Message can't be empty")
	}

	if len(message) > maxCharsCount {
		panic("Message is too long")
	}

	id := nextID
	feedbacks = append(feedbacks, Feedback{
		ID:        id,
		User:      std.GetOrigCaller(),
		Content:   stripHtml(message),
		CreatedAt: time.Now(),
	})

	nextID++
	return ufmt.Sprintf("Feedback submitted successfully. See all feedback at %s", realmViewPath)
}

// BanFeedback used by moderation team to remove feedbacks which violate code of conduct.
func BanFeedback(feedbackID int) string {
	assertIsModerator()

	i, ok := findFeedback(feedbackID)
	if !ok {
		panic("Feedback not found")
	}

	// Still keep the record but remove a harmful message.
	feedbacks[i].Content = ""
	return "Feedback was removed by a moderator"
}

// RespondToFeedback allows any moderator or realm owner to leave a response to a feedback.
func RespondToFeedback(feedbackID int, response string) string {
	assertNotLocked()
	assertIsModerator()

	i, ok := findFeedback(feedbackID)
	if !ok {
		panic("Feedback not found")
	}

	feedback := feedbacks[i]
	if feedback.Response != "" {
		panic("Feedback already has a response")
	}

	response = strings.TrimSpace(response)
	if response == "" {
		panic("Response can't be empty")
	}

	if len(response) > maxCharsCount {
		panic("Response is too long")
	}

	feedback.RespondAt = time.Now()
	feedback.Response = stripHtml(response)
	feedbacks[i] = feedback

	return "Response recorded successfully"
}

// GetRole returns a role name of a caller (admin, moderator or guest).
func GetRole() string {
	actorId := std.GetOrigCaller()
	if actorId == ownerAddr {
		return "admin"
	}

	if i := findModerator(actorId); i != notFoundIndex {
		return "moderator"
	}

	return "guest"
}

// AddModerator adds a new wallet address to a list of moderators.
func AddModerator(addr std.Address) string {
	assertIsOwner()
	assertAddrValid(addr)

	i := findModerator(addr)
	if i != notFoundIndex {
		panic("Entry already exists")
	}

	modAddrs = append(modAddrs, addr)
	return "Success"
}

// RemoveModerator removes a wallet address from a list of moderators.
func RemoveModerator(addr std.Address) string {
	assertIsOwner()
	assertAddrValid(addr)

	i := findModerator(addr)
	if i == notFoundIndex {
		panic("Entry not found")
	}

	modAddrs = append(modAddrs[:i], modAddrs[i+1:]...)
	return "Success"
}

// MarkRealmDeprecated marks realm as deprecated, locks feedback recording and shows a new realm path at page.
func MarkRealmDeprecated(newPath string) {
	assertIsOwner()
	newPath = strings.TrimSpace(newPath)
	if newPath == "" {
		panic("New path is empty")
	}

	isLocked = true
	migratedRealmPath = newPath
}

func writeHyperlink(w *strings.Builder, label, url string) {
	w.WriteString("[")
	w.WriteString(label)
	w.WriteString("](")
	w.WriteString(url)
	w.WriteString(")")
}

func renderRealmDisclaimer(w *strings.Builder) {
	if !isLocked {
		return
	}

	w.WriteString(`<p style="padding: .75rem 1.25rem; border: 1px solid #FFEEBA; background-color: #FFF3CD; color: #856404; border-radius: .25rem">Realm is locked.`)
	if migratedRealmPath != "" {
		w.WriteString(` Realm is moved to <a href="`)
		w.WriteString(migratedRealmPath)
		w.WriteString(`">`)
		w.WriteString(migratedRealmPath)
		w.WriteString("</a>")
	}
	w.WriteString("</p>\n\n")
}

// Render displays all feedback and responses.
func Render(_ string) string {
	sb := &strings.Builder{}
	sb.WriteString("# Gno Studio Feedback Collection\n")

	renderRealmDisclaimer(sb)
	if !isLocked {
		writeHyperlink(sb, "👉 Click here to submit your feedback 👈", feedbackFormPath)
		sb.WriteString("\n\n")
	}

	for i := len(feedbacks) - 1; i >= 0; i-- {
		fb := feedbacks[i]
		sb.WriteString(ufmt.Sprintf("## Feedback #%d\n", fb.ID))
		sb.WriteString(ufmt.Sprintf("From `%s` at %s\n\n", fb.User, fb.CreatedAt.Format(time.RFC1123)))
		if fb.Content == "" {
			sb.WriteString("*Feedback was removed by a moderator*")
		} else {
			sb.WriteString(fb.Content)
		}
		sb.WriteString("\n\n")

		if fb.Response == "" {
			continue
		}

		sb.WriteString("### Response\n")
		sb.WriteString(ufmt.Sprintf("At %s\n\n", fb.RespondAt.Format(time.RFC1123)))
		sb.WriteString(fb.Response)
		sb.WriteString("\n\n")
	}

	if len(feedbacks) == 0 {
		sb.WriteString("*No Feedback*\n\n")
	}

	return sb.String()
}

package forms

import (
	"std"
	"time"

	"gno.land/p/demo/json"
	"gno.land/p/demo/ufmt"
)

func (form *Form) AddField(label string, fieldType string, required bool) {
	field := Field{
		Label:     label,
		FieldType: fieldType,
		Required:  required,
	}

	form.Fields = append(form.Fields, field)
}

func (db *FormDatabase) GetForm(id string) *Form {
	for _, form := range db.Forms {
		if form.ID == id {
			return form
		}
	}
	return nil
}

func (db *FormDatabase) CreateForm(title string, description string, openAt string, closeAt string, data string) string {
	id := db.IDCounter.Next().String()

	form := &Form{
		ID:          id,
		Owner:       std.PrevRealm().Addr(),
		Title:       title,
		Description: description,
		CreatedAt:   time.Now().String(),
		OpenAt:      openAt,
		CloseAt:     closeAt,
	}

	db.Forms = append(db.Forms, form)

	node, err := json.Unmarshal([]byte(data))
	if err != nil {
		ufmt.Errorf("error: %v", err)
	}

	// Parsing the json submission to create the gno data structures
	for i := 0; i < node.Size(); i++ {
		field, err := node.GetIndex(i)

		if err != nil {
			ufmt.Errorf("error: %v", err)
		}

		labelNode, _ := field.GetKey("label")
		fieldTypeNode, _ := field.GetKey("fieldType")
		requiredNode, _ := field.GetKey("required")

		label, _ := labelNode.GetString()
		fieldType, _ := fieldTypeNode.GetString()
		required, _ := requiredNode.GetBool()

		form.AddField(label, fieldType, required)
	}

	return id
}

package forms

import (
	"std"
	"testing"

	"gno.land/p/demo/testutils"
)

func TestCreateForm(t *testing.T) {
	alice := testutils.TestAddress("alice")
	std.TestSetOrigCaller(alice)

	title := "Simple Form"
	description := "This is a form"
	openAt := "2021-01-01T00:00:00Z"
	closeAt := "2021-01-02T00:00:00Z"
	data := `[
		{
			"label": "Name",
			"fieldType": "string",
			"required": true
		},
		{
			"label": "Age",
			"fieldType": "number",
			"required": false
		},
		{
			"label": "Is this a test?",
			"fieldType": "boolean",
			"required": false
		},
		{
			"label": "Favorite Food",
			"fieldType": "['Pizza', 'Schnitzel', 'Burger']",
			"required": true
		},
		{
			"label": "Favorite Foods",
			"fieldType": "{'Pizza', 'Schnitzel', 'Burger'}",
			"required": true
		}
	]`
	db := NewDatabase()
	id := db.CreateForm(title, description, openAt, closeAt, data)
	if id == "" {
		t.Error("Form ID is empty")
	}
	form := db.GetForm(id)
	if form == nil {
		t.Error("Form is nil")
	}
	if form.Owner != alice {
		t.Error("Owner is not correct")
	}
	if form.Title != title {
		t.Error("Title is not correct")
	}
	if form.Description != description {
		t.Error("Description is not correct")
	}
	if len(form.Fields) != 5 {
		t.Error("Fields are not correct")
	}
	if form.Fields[0].Label != "Name" {
		t.Error("Field 0 label is not correct")
	}
	if form.Fields[0].FieldType != "string" {
		t.Error("Field 0 type is not correct")
	}
	if form.Fields[0].Required != true {
		t.Error("Field 0 required is not correct")
	}
	if form.Fields[1].Label != "Age" {
		t.Error("Field 1 label is not correct")
	}
	if form.Fields[1].FieldType != "number" {
		t.Error("Field 1 type is not correct")
	}
}

package forms

import (
	"std"

	"gno.land/p/demo/seqid"
)

type Field struct {
	Label string

	/*
		string: "string";
		number: "number";
		boolean: "boolean";
		choice: "['Pizza', 'Schnitzel', 'Burger']";
		multi-choice: "{'Pizza', 'Schnitzel', 'Burger'}";
	*/
	FieldType string

	Required bool
}

type Form struct {
	ID    string
	Owner std.Address

	Title       string
	Description string
	Fields      []Field

	CreatedAt string
	OpenAt    string
	CloseAt   string
}

type Submission struct {
	FormID string

	Author std.Address

	/* ["Alex", 21, true, 0, [0, 1]] */
	Answers string // json

	SubmittedAt string
}

type FormDatabase struct {
	Forms []*Form

	Answers []*Submission

	IDCounter seqid.ID
}

func NewDatabase() *FormDatabase {
	return &FormDatabase{
		Forms:   make([]*Form, 0),
		Answers: make([]*Submission, 0),
	}
}

package forms

import (
	"std"
	"time"

	"gno.land/p/demo/ufmt"
)

func (db *FormDatabase) SubmitForm(formID string, answers string) {
	form := db.GetForm(formID)
	if form == nil {
		panic(ufmt.Errorf("Form not found: %s", formID))
	}

	if ValidateAnswers(answers, form.Fields) == false {
		panic("Invalid answers")
	}

	answer := &Submission{
		FormID:      formID,
		Answers:     answers,
		Author:      std.PrevRealm().Addr(),
		SubmittedAt: time.Now().String(),
	}

	db.Answers = append(db.Answers, answer)
}

func (db *FormDatabase) GetAnswer(formID string, authorID string) *Submission {
	for _, answer := range db.Answers {
		if answer.FormID == formID && answer.Author.String() == authorID {
			return answer
		}
	}
	return nil
}

package forms

import (
	"testing"
)

func TestAnswerForm(t *testing.T) {
	db := NewDatabase()

	data := `[
		{
			"label": "Name",
			"fieldType": "string",
			"required": true
		},
		{
			"label": "Age",
			"fieldType": "number",
			"required": false
		},
		{
			"label": "Is this a test?",
			"fieldType": "boolean",
			"required": false
		},
		{
			"label": "Favorite Food",
			"fieldType": "[Pizza|Schnitzel|Burger]",
			"required": true
		},
		{
			"label": "Favorite Foods",
			"fieldType": "{Pizza|Schnitzel|Burger}",
			"required": true
		}
	]`

	formID := db.CreateForm("Test Form", "Test Description", "2020-01-01", "2020-01-02", data)
	answers := `["Alex", 21, true, 0, [0, 1]]`

	db.SubmitForm(formID, answers)

	if len(db.Answers) != 1 {
		t.Errorf("Expected 1 answer, got %d", len(db.Answers))
	}

	if db.Answers[0].FormID != formID {
		t.Errorf("Expected form ID %s, got %s", formID, db.Answers[0].FormID)
	}

	if db.Answers[0].Answers != answers {
		t.Errorf("Expected answers %s, got %s", answers, db.Answers[0].Answers)
	}
}

package forms

import (
	"strings"

	"gno.land/p/demo/json"
)

func ValidateBooleanField(node *json.Node, field Field) bool {
	if node.IsBool() == false {
		return false
	}

	answer, err := node.GetBool()
	if err != nil {
		return false
	}

	if field.Required == true && answer == false {
		return false
	}

	return true
}

func ValidateStringField(node *json.Node, field Field) bool {
	if node.IsString() == false {
		return false
	}

	answer, err := node.GetString()
	if err != nil {
		return false
	}

	if field.Required == true && answer == "" {
		return false
	}

	return true
}

func ValidateNumberField(node *json.Node, field Field) bool {
	if node.IsNumber() == false {
		return false
	}

	answer, err := node.GetNumeric()
	if err != nil {
		return false
	}

	if field.Required == true && answer == 0 {
		return false
	}

	return true
}

func ValidateMultiChoiceField(node *json.Node, field Field) bool {
	choices := strings.Split(field.FieldType[1:len(field.FieldType)-1], "|")

	if node.IsArray() == false {
		return false
	}

	if field.Required == true && node.Size() == 0 {
		return false
	}

	if node.Size() > len(choices) {
		return false
	}

	for i := 0; i < node.Size(); i++ {
		choiceNode, err := node.GetIndex(i)
		if err != nil {
			return false
		}

		choiceIdx := choiceNode.MustNumeric()
		if choiceIdx < 0 || int(choiceIdx) >= len(choices) {
			return false
		}
	}

	return true
}

func ValideChoiceField(node *json.Node, field Field) bool {
	choices := strings.Split(field.FieldType[1:len(field.FieldType)-1], "|")

	if node.IsNumber() == false {
		return false
	}

	choiceIdx := node.MustNumeric()
	if choiceIdx < 0 || int(choiceIdx) >= len(choices) {
		return false
	}

	return true
}

func ValidateAnswers(answers string, fields []Field) bool {
	unmarshalled, err := json.Unmarshal([]byte(answers))
	if err != nil {
		return false
	}

	if len(fields) != unmarshalled.Size() {
		return false
	}

	for i, field := range fields {
		answer, err := unmarshalled.GetIndex(i)
		if err != nil {
			return false
		}
		if field.FieldType == "boolean" {
			if ValidateBooleanField(answer, field) == false {
				return false
			}
		}
		if field.FieldType == "string" {
			if ValidateStringField(answer, field) == false {
				return false
			}
		}
		if field.FieldType == "number" {
			if ValidateNumberField(answer, field) == false {
				return false
			}
		}
		if field.FieldType[0] == '{' && field.FieldType[len(field.FieldType)-1] == '}' {
			if ValidateMultiChoiceField(answer, field) == false {
				return false
			}
		}
		if field.FieldType[0] == '[' && field.FieldType[len(field.FieldType)-1] == ']' {
			if ValideChoiceField(answer, field) == false {
				return false
			}
		}
	}

	return true
}

package forms

import (
	"testing"
)

func TestAnswerFormInvalidForm(t *testing.T) {
	db := NewDatabase()

	data := `[
		{
			"label": "Name",
			"fieldType": "string",
			"required": true
		},
		{
			"label": "Age",
			"fieldType": "number",
			"required": false
		},
		{
			"label": "Is this a test?",
			"fieldType": "boolean",
			"required": false
		},
		{
			"label": "Favorite Food",
			"fieldType": "[Pizza|Schnitzel|Burger]",
			"required": true
		},
		{
			"label": "Favorite Foods",
			"fieldType": "{Pizza|Schnitzel|Burger}",
			"required": true
		}
	]`

	formID := db.CreateForm("Test Form", "Test Description", "2020-01-01", "2020-01-02", data)

	tests := []struct {
		name        string
		answer      string
		expectPanic bool
	}{
		{
			name:        "correct",
			answer:      `["Alex", 21, true, 0, [0, 1]]`,
			expectPanic: false,
		},
		{
			name:        "invalid string",
			answer:      `[0, 21, true, 0, [0, 1]`,
			expectPanic: true,
		},
		{
			name:        "invalid number",
			answer:      `["Alex", "21", true, 0, [0, 1]]`,
			expectPanic: true,
		},
		{
			name:        "invalid boolean",
			answer:      `["Alex", 21, 1, 0, [0, 1]]`,
			expectPanic: true,
		},
		{
			name:        "invalid choice",
			answer:      `["Alex", 21, true, 10, [0, 1]]`,
			expectPanic: true,
		},
		{
			name:        "invalid multi-choice 1",
			answer:      `["Alex", 21, true, 0, [0, 1, 2, 3, 4, 5]]`,
			expectPanic: true,
		},
		{
			name:        "invalid multi-choice 2",
			answer:      `["Alex", 21, true, 0, [5]]`,
			expectPanic: true,
		},
		{
			name:        "invalid multi-choice 3",
			answer:      `["Alex", 21, true, 0, 0]`,
			expectPanic: true,
		},
		{
			name:        "required string",
			answer:      `["", true, 0, [0, 1]]`,
			expectPanic: true,
		},
	}

	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			defer func() {
				if r := recover(); r != nil {
					if tt.expectPanic {
						return
					}
					t.Errorf("%s panic occurred when not expected: %v", tt.name, r)
				} else if tt.expectPanic {
					t.Errorf("%s expected panic but didn't occur", tt.name)
				}
			}()

			db.SubmitForm(formID, tt.answer)
		})
	}
}

package forms

import (
	"std"
	"time"

	"gno.land/p/demo/json"
	"gno.land/p/demo/ufmt"
)

func (form *Form) AddField(label string, fieldType string, required bool) {
	field := Field{
		Label:     label,
		FieldType: fieldType,
		Required:  required,
	}

	form.Fields = append(form.Fields, field)
}

func (db *FormDatabase) GetForm(id string) *Form {
	for _, form := range db.Forms {
		if form.ID == id {
			return form
		}
	}
	return nil
}

func (db *FormDatabase) CreateForm(title string, description string, openAt string, closeAt string, data string) string {
	id := db.IDCounter.Next().String()

	form := &Form{
		ID:          id,
		Owner:       std.PrevRealm().Addr(),
		Title:       title,
		Description: description,
		CreatedAt:   time.Now().String(),
		OpenAt:      openAt,
		CloseAt:     closeAt,
	}

	db.Forms = append(db.Forms, form)

	node, err := json.Unmarshal([]byte(data))
	if err != nil {
		ufmt.Errorf("error: %v", err)
	}

	// Parsing the json submission to create the gno data structures
	for i := 0; i < node.Size(); i++ {
		field, err := node.GetIndex(i)

		if err != nil {
			ufmt.Errorf("error: %v", err)
		}

		labelNode, _ := field.GetKey("label")
		fieldTypeNode, _ := field.GetKey("fieldType")
		requiredNode, _ := field.GetKey("required")

